import React, { useState, useContext } from "react";
import axios from "axios";
import "./VirtualTry.css";
import { ShopContext } from "../../Context/ShopContext";
import { useParams } from "react-router-dom";

const VirtualTry = () => {
  const { productId } = useParams();
  const [personImage, setPersonImage] = useState(null);
  const [resultImage, setResultImage] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");
  const { addToCart, all_product } = useContext(ShopContext);

  const product = all_product.find((p) => p.id === Number(productId));

  // Handle person image upload
  const handlePersonImageUpload = (event) => {
    setPersonImage(event.target.files[0]);
  };

  // Add product to cart
  const handleAddToCart = () => {
    if (product) {
      addToCart(product.id);
      alert("Product added to cart!");
    }
  };

  // Handle virtual try-on process
  const handleTryOn = async () => {
    if (!personImage) {
      setErrorMessage("Please upload a person image.");
      return;
    }

    const formData = new FormData();
    formData.append("personImage", personImage);
    formData.append("productImageUrl", product?.image); // Pass product image URL

    try {
      setIsLoading(true);
      const response = await axios.post(
        "http://localhost:4000/process-vitons",
        formData,
        {
          headers: { "Content-Type": "multipart/form-data" },
        }
      );

      if (response.data && response.data.result) {
        setResultImage(`http://localhost:4000${response.data.result}`);
        setErrorMessage("");
      } else {
        setErrorMessage("Something went wrong! Please try again.");
      }
    } catch (error) {
      console.error(error);
      setErrorMessage("Failed to process the try-on request.");
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="virtual-try-page">
      <div className="virtual-try-container">
        <h1 className="virtual-try-title">Virtual Try-On Experience</h1>
        <p className="virtual-try-description">
          Upload your photo and see how the product looks on you!
        </p>

        {product && (
          <div className="product-info">
            <img
              src={product.image}
              alt={product.name}
              className="product-preview-image"
            />
            <h3 className="product-name">{product.name}</h3>
          </div>
        )}

        <div className="image-upload-section">
          <label htmlFor="person-upload" className="button upload-image-button">
            Upload Your Image
          </label>
          <input
            id="person-upload"
            type="file"
            accept="image/*"
            onChange={handlePersonImageUpload}
            className="file-input"
            style={{ display: "none" }}
          />
        </div>

        {personImage && (
          <div className="uploaded-image-preview">
            <h4>Your Uploaded Image:</h4>
            <img
              src={URL.createObjectURL(personImage)}
              alt="Uploaded person"
              className="uploaded-image"
            />
          </div>
        )}

        <div className="button-section">
          <button
            onClick={handleTryOn}
            className="button try-on-button"
            disabled={isLoading}
          >
            Try On
          </button>
        </div>

        {isLoading && (
          <div className="loading-overlay">
            <div className="spinner"></div>
            <p>Your try-on image is processing, please wait...</p>
          </div>
        )}

        {resultImage && (
          <div className="result-section">
            <h3>Your Try-On Result</h3>
            <img src={resultImage} alt="Try-on result" className="result-image" />
          </div>
        )}

        <div className="add-to-cart-section">
          <button
            onClick={handleAddToCart}
            className="button add-to-cart-button"
          >
            Add to Cart
          </button>
        </div>

        {errorMessage && <p className="error-message">{errorMessage}</p>}
      </div>
    </div>
  );
};

export default VirtualTry;
